import { createRouter, createWebHashHistory } from 'vue-router'

import id_component from '../views/id_component.vue'
import time_component from '../views/time_component.vue'
import hash_component from '../views/hash_component.vue'
import crypto_component from '../views/crypto_component.vue'
import string_component from '../views/string_component.vue'

const routes = [
  {
    path: '/',
    name: 'id',
    component: id_component
  },
  {
    path: '/time',
    name: 'time',
    component: time_component
  },
  {
    path: '/hash',
    name: 'hash',
    component: hash_component
  },
  {
    path: '/crypto',
    name: 'crypto',
    component: crypto_component
  },
  {
    path: '/string',
    name: 'string',
    component: string_component
  },
  {
    path: '/about',
    name: 'about',
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () => import(/* webpackChunkName: "about" */ '../views/AboutView.vue')
  }
]

const router = createRouter({
  history: createWebHashHistory(),
  routes
})

export default router
